import React from "react";

export const Calendar = () => {
  return (
    <div>
      <div className="sidebar">
        <div className="sidebar-content">
          <ul className="sidebar-menu">
            <li>
              <Link
                style={{ color: "white", textDecoration: "none" }}
                to="/dashboard"
              >
                Events
              </Link>
            </li>
          </ul>
          <div className="sidebar-logout"></div>
        </div>
      </div>
    </div>
  );
};
